import React, { Component } from 'react';
class TinTuc extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: ""
    };
  }
  async componentDidMount() {
    //const response = await fetch('server-spring-boot-api.herokuapp.com/api/CheckKey111');
    //fetch("server-spring-boot-api.herokuapp.com/api/CheckKey")
    async function fetchTest() {
      let response = await fetch('server-spring-boot-api.herokuapp.com/api/CheckKey', {method : "POST"});
      let responseText = await response.text();

      alert(responseText);
    }

    (async () => {
      await fetchTest();
    })();

  }


  render() {

    return (
      <div>{this.state.items}</div>
    )
  }
}
export default TinTuc;
